import React from 'react'
import { useNavigate } from 'react-router-dom';

const Header = () => {
    let navigate = useNavigate();

    return (
        <header style={styles.headerContainer}>
            <div style={styles.logo}>
                <span>Julian van Beek</span>
                <span>Web Designer</span>
            </div>
            <nav style={styles.navContainer}>
                <ul style={styles.navList}>
                    <li style={styles.navListItem} onClick={() => {
                        navigate('/')
                    }}>
                        <a style={styles.navListLink} href=''>Home</a>
                    </li>
                    <li style={styles.navListItem} onClick={() => {
                        navigate('/')
                    }}>
                        <a style={styles.navListLink} href=''>Portfolio</a>
                    </li>
                    <li style={styles.navListItem} onClick={() => {
                        navigate('/')
                    }}>
                        <a style={styles.navListLink} href=''>About</a>
                    </li>
                    <li style={styles.navListItem} onClick={() => {
                        navigate('/')
                    }}>
                        <a style={styles.navListLink} href=''>Contact</a>
                    </li>
                </ul>
            </nav>
        </header>
    );
}

export default Header;

const styles = {
    headerContainer: {
        background: '#111',
        display: 'flex',
        justifyContent: 'space-between'
    },

    logo: {
        color: 'white'
    },

    navContainer: {
    },

    navList: {
        display: 'flex',
        listStyleType: 'none'
    },

    navListItem: {

    },

    navListLink: {
        color: 'white',
        textDecoration: 'none'
    }
}
